import React, { useState } from 'react';
import VideoPlayer from '../components/VideoPlayer';
import { videosData } from '../data/videosData';
import '../styles/components.css';

const Videos = () => {
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [watchedVideos, setWatchedVideos] = useState([]);

  const categories = ['All', 'ETL', 'SQL', 'Python', 'Big Data', 'Cloud', 'Interview Prep'];

  const filteredVideos = selectedCategory === 'All' 
    ? videosData 
    : videosData.filter(video => video.category === selectedCategory);

  const handleMarkWatched = (videoId) => {
    if (!watchedVideos.includes(videoId)) {
      setWatchedVideos([...watchedVideos, videoId]);
    }
  };

  return (
    <div className="videos-page">
      <div className="videos-header">
        <h2>Video Tutorials Library</h2>
        <p>Watch and learn from expert data engineers</p>
      </div>
      
      <div className="category-filters">
        {categories.map(category => (
          <button
            key={category}
            className={`category-filter-btn ${selectedCategory === category ? 'active' : ''}`}
            onClick={() => setSelectedCategory(category)}
          >
            {category}
          </button>
        ))}
      </div>
      
      <div className="videos-stats">
        <div className="video-stat">
          <span className="stat-number">{filteredVideos.length}</span>
          <span className="stat-label">Videos Available</span>
        </div>
        <div className="video-stat">
          <span className="stat-number">{watchedVideos.length}</span>
          <span className="stat-label">Watched</span>
        </div>
        <div className="video-stat">
          <span className="stat-number">
            {Math.round((watchedVideos.length / filteredVideos.length) * 100) || 0}%
          </span>
          <span className="stat-label">Completion</span>
        </div>
      </div>
      
      <div className="featured-video">
        <div className="featured-content">
          <h3>Featured Tutorial: Building ETL Pipelines with Python</h3>
          <p>Learn how to create robust ETL pipelines using Python, Pandas, and Apache Airflow</p>
          <button className="watch-featured-btn">Watch Now</button>
        </div>
      </div>
      
      <div className="videos-grid">
        {filteredVideos.map(video => (
          <VideoPlayer 
            key={video.id} 
            video={video}
            onMarkWatched={handleMarkWatched}
          />
        ))}
      </div>
      
      <div className="youtube-channel">
        <h3>Recommended YouTube Channels</h3>
        <div className="channels-list">
          <div className="channel-card">
            <div className="channel-logo">D</div>
            <div className="channel-info">
              <h4>Data Engineering with DataCamp</h4>
              <p>Professional data engineering tutorials and courses</p>
              <a href="#" className="subscribe-link">Subscribe</a>
            </div>
          </div>
          <div className="channel-card">
            <div className="channel-logo">A</div>
            <div className="channel-info">
              <h4>Apache Spark Tutorials</h4>
              <p>Deep dive into Spark and distributed computing</p>
              <a href="#" className="subscribe-link">Subscribe</a>
            </div>
          </div>
          <div className="channel-card">
            <div className="channel-logo">C</div>
            <div className="channel-info">
              <h4>Cloud Data Engineering</h4>
              <p>AWS, Azure, GCP data engineering services</p>
              <a href="#" className="subscribe-link">Subscribe</a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Videos;
